description:
Join us as we gather for A Day for Democracy! This nonpartisan, family-friendly event will host hands-on opportunities for civic engagement and complimentary ice cream from Ben & Jerry's. We will be joined by organizations on-site to provide information and actionable steps on how to defend our democracy. We will welcome powerful speakers as well as enjoy live music from The Seth Yacavone Band. The confirmed list of attendees (more to follow) is below:

Attorney General Charity Clark;
Secretary of State Sarah Copeland-Hanzas;
State Treasurer Mike Pieciak;
Author, Sociologist and Educator Nikhil Goyal;
Former Vermont House Speaker Shap Smith;
Founder & Editor-at-Large, VT Digger, Anne Halloway;

